import {
  Fetch_Data_Error,
  Fetch_Data_Success,
  Fetch_Data_Request,
} from "./DataTypes";

const initialState = {
  Loading: false,
  Data: [],
  error: "",
};

const DataReducer = (state = initialState, action) => {
  console.log("DataReducer", action.payload);
  switch (action.type) {
    case Fetch_Data_Request:
      return {
        ...state,
        Loading: true,
      };

    case Fetch_Data_Success:
      return {
        ...state,
        Loading: false,
        Data: action.payload,
        error: "",
      };

    case Fetch_Data_Error:
      return {
        ...state,
        Loading: false,
        Data: [],
        error: action.payload,
      };

    default:
      return state;
  }
};
export default DataReducer;
